import FilterButton from "./FilterButton";

function FilterContainer() {

  const srcList = [
    "/images/전체.svg",
    "/images/상품.svg",
    "/images/카테고리.svg",
    "/images/기획전.svg",
    "/images/브랜드.svg",
  ];


  return (
    <div>
    <ul className="Filter_container">
    {FilterButton(srcList[0])}
      <FilterButton/>
      <FilterButton/>
      <FilterButton/>
      <FilterButton/>
      <FilterButton/>
    </ul>
  </div>
);
}

export default FilterContainer;
